script: |
  super -f text -I q2160.spq | sort > q2160.out

inputs:
  - name: q2160.spq
    data: |
      SELECT col1 * - + ( - + col0 ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col2 NOT BETWEEN - CAST ( NULL AS INTEGER ) / + col1 AND + 17;
  - name: tab0

outputs:
  - name: q2160.out
    data: |
